import { __decorate } from "tslib";
import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
let TicketBookingService = class TicketBookingService {
    constructor(httpClient) {
        this.httpClient = httpClient;
        this.url = 'https://localhost:7083/api/v1/moviebooking';
    }
    bookTickets(movie, nofoTickets) {
        return this.httpClient.post(this.url + '/' + movie.movieName + '/add/' + nofoTickets, { responseType: 'text' });
    }
};
